/*
 * AccessPhoto Brown
 *
 * Author      : Chris Emanuel
 * Updated     : May 30th, 2008
 * Website     : http://www.chrisemanuelphotography.webs.com/
 * Description : Modifies the colors and layout of AccessPhoto.com
 * Usage       : Use with Stylish Firefox extension (http://userstyles.org/) or copy to your Firefox userContent.css file
 */

@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix(http://www.accessphoto.com/), url-prefix(http://accessphoto.com/) {
body {
background: #3D311B !important;
background-image: 
url('data:image/jpeg;base64,') !important;
background-repeat: repeat !important;
background-attachment: fixed !important;
font-family: Tahoma, Arial, Helvetica, sans-serif !important;}
table {
border: double #030303 !important;
background: #29200F !important;}
#ipbwrapper
{
width: 85% !important;
border: double #030303 !important;
background: #3D311B !important;
-moz-opacity:.90 !important;
opacity:.90 !important;}
.newslink {
border: double #030303 !important;}
.maintitlecollapse {
background: #29200F !important;}
.row1 {
background: #29200F !important;}
.row2 {
background: #29200F !important;}
.catend {
background: #29200F;}
a:link,
a:visited,
a:active {
color: #CD853F !important;}
a:hover {
color: #D2B48C !important;}
.forumdesc,
.forumdesc a:link,
.forumdesc a:visited,
.forumdesc a:active {
color: #D2B48C !important;}
.largerTitlesLowerCase {
color: #CD853F !important;}
}
